Job Description:
Data Scientist
At SalesPad, we know the importance of being data-driven. As a pillar of our Core Values, we use data to fuel and support our decision-making. We are seeking an experienced Data Scientist to deliver insight and extract meaning from our data, providing knowledge to the Team that we can use to build and improve our solutions.
A typical day of a Data Scientist would include:
Partnering with the Development and Product Teams to understand their goals and determine how data can be used to achieve those goals;
Understanding business problems and using mathematical frameworks to deliver machine learning models that can be used to solve those;

